import React from 'react';
import { Track } from '../Track/Track';

export class Tracklist extends React.Component {
    render() {
        return (
            <div class="TrackList">
                { this.props.tracks.map((track) => {return <Track key={track.id} onAdd={this.props.onAdd} track={track} />} ) }
            </div>
        )
    }
}
